import React from 'react'

const FetchImg = () => {
  const [imageLink, setImageLink] = useState([]);
  return (
    <div>
      {imageLink? 
      <img src="" alt="" /> :
      <h1>Loading...</h1>
      }
    </div>
  )
}

export default FetchImg
